import styled from 'styled-components';

export const Container = styled.div`
    display : flex;
    width : 100% ;
    box-sizing : border-box;
    box-shadow: 0 2px 5px 0 rgba(0,0,0,.5);
    height:67px;
    padding: relative;

    @media (min-width : 768px){
        height:110px;
    }


`;

export const Logo = styled.div
